import React from "react"


class Users extends React.Component {
    users = [
        {
            id: 1,
            firstname: 'Bob',
            lastname: 'Marley',
            age: 40,
            isHappy: true
        },
        {
            id: 2,
            firstname: 'John',
            lastname: 'Doe',
            age: 22,
            isHappy: false   
        }
    ]
    render() {
        return (<div>
            {this.users.map((el) => (<div>
                <h3>{el.firstname}{el.lastname}</h3>
                <p>{el.age}</p>
            </div>))}
        </div>)
    }
}

export default Users
